        <label htmlFor="lastName">Last name</label>
        <Input
          className={`${className}__field__lastName`}
          type="text"
          placeholder="Last name"
          register={register("lastName")}
        />
        {errors.lastName && (
          <small className="text-tags-4">{errors.lastName.message}</small>
        )}
      </form.Field>

      {/* Phone number */}
      <form.Field className={`${className}__field`}>
        <label htmlFor="phone">Phone number</label>
        <Input
          className={`${className}__field__phone`}
          type="text"
          placeholder="Phone number"
          register={register("phone")}
        />
        {errors.phone && (
          <small className="text-tags-4">{errors.phone.message}</small>
        )}
      </form.Field>

      {/* Submit button */}
      <form.Field className={`${className}__field`}>
        <LoadingButton
          className={`${className}__field__btn btn`}
          status={updateProfileStatus}
          type="submit"
        >
          Update Profile
          <GoMoveToTop size={20} />
        </LoadingButton>
      </form.Field>
    </form.Form>
  );
};

export default Form;

